import React, { Component } from 'react'
import './index.css'
export default class Header extends Component {
    handleKeyUp = (e) => {
        console.log(e.target.value)
    }

    render() {
        return (
            <div className="todo-header">
                <input onKeyUp={this.handleKeyUp} type="text" placeholder="input your task name, press enter to confirm" />
            </div>
        )
    }
}
